import React from 'react';
import logo from './logo.svg';
import './App.css';
import Infograph from './components/Infograph/infograph';
import MyBio from './components/Story/story';
import Test from './components/Test/test'

function App() {
  return (
    <div>
      <body>
      <MyBio className='story'/>
      <Infograph />
      <Test />
      </body>
    </div>
  );
}

export default App;
